@Inna @swasilenko there were some contributions that I wasn't able to tell if they were genuine or not. 

I apologize for any efforts that I have mistakenly missed (and I also apologies for any points I have mistakenly granted to malicious accounts that are trying to take advantage of this otherwise great and positive challenge, this is an unfortunate reality of any community.) 

If you both send me a DM I will do a quick verification and fix this oversight. I will do my best to make sure all honest contributions receive recognition. Thank you all for participating in this awesome challenge and thanks to @zafkiv for suggesting it. :eco_heart:

#📦ii-trash-pickup-challenge 
@Dave | Eco @SpaceTraveler @Andy | Eco @Henry  |  Eco @Hen | Eco 
Hi all! Yesterday my husband and I were cleaning the area near the Danube River. We cleaned the territory and went to take the garbage to the dump. There we met a wonderful dog, she is friendly but still afraid to come close to people. We had no food and today we returned to feed her. Tomorrow we will go back to her place and try to cut her hair. I sent out a video with a dog to forums. I hope I can find a home for her 😔

@Dave | Eco We have a tradition in our family - every spring to clean up near our house.
I think we need to set an example for our children.
We had a great time and cleared out the trash from our yard.
